  true,\n\t\"url\": null,\n\t\"notes\": \"The IceBridge Mission Flight Reports data
  set contains flight reports from NASA Operation IceBridge Greenland, Arctic, Antarctic,
  and Alaska missions.  Flight reports contain information on region, mission, aircraft
  model, flight data, purpose of flight, and on-board sensors. The flight reports
  were collected as part of Operation IceBridge funded aircraft survey campaigns.
  \ The reports are stored in ASCII text and PDF formats and are available for periodic,
  ongoing campaigns from 27 March 2009 to the present via FTP.n\",\n\t\"license_title\":
